import styled from 'styled-components';

const PrettyHome = styled('div')`
        padding-right: 15px;
        padding-left: 15px;
        margin-right: auto;
        margin-left: auto;

        display: flex;
        flex-direction: column;
        align-items: center;
        .genderForm {
            width: 20%;
            margin: 30px;
            flex-basis: auto;
            @media(max-width: 700px) {
                width: 80%;
                margin-top: 20px;
            }
        }
        .categoryForm {
            width: 30%;
            margin-bottom: 30px;
            flex-basis: auto;
            @media(max-width: 700px) {
                width: 80%;
                margin-top: 20px;
            }
        }
`;

export default PrettyHome ;
